import api from "../api";

export const fetchFaq = () => async dispatch  => {
    const response = await api.get('/mini-project/faq.json');

    console.log(response.data,"action");

    dispatch({
        type: 'FETCH_FAQ',
        payload: await response.data
    });
};

export const fetchMenu = () => async dispatch  => {
    const response = await api.get('/mini-project/menu.json');

    console.log(response.data["menu-items"],"response");

    dispatch({
        type: 'FETCH_MENU',
        payload: response.data["menu-items"]
    });
};
